import React from "react";

function SearchResultItem(props) {
    const {data} = props;
    console.log ('data', data);
    return (
        <div className='search-result'>
            <div className='left'>
                <img src={data.image.url} alt='image' />
            </div>
            <div className='right'>
                <h3>batman</h3>
                <div className='biography'>
                    <h5>{data.name}</h5>
                    <div>Batman II</div>
                    <div>The Tomorrow Knight</div>
                    <div>The second Dark Knight</div>
                    <div>The Dark Knight of Tomorrow</div>
                </div>
            </div>
        </div>
    )
}

export default SearchResultItem;
